INSERT INTO `copypasta` VALUES (19,'All hail Â¯\\\\_(ãƒ„)_/Â¯.\nIn its 11 strokes, the symbol encapsulates what itâ€™s like to be an individual on the Internet. With raised arms and a half-turned smile, it exudes the melancholia, the malaise, the acceptance, and (finally) the embrace of knowing that somethingâ€™s wrong on the Internet and you canâ€™t do anything about it.\\nAs Kyle Chayka writes in a new history of the symbol at The Awl, the meaning of the â€œthe shruggieâ€ is always two, if not three- or four-, fold. Â¯\\\\_(ãƒ„)_/Â¯ represents nihilism, â€œbemused resignation,â€ and â€œa Zen-like tool to accept the chaos of universe.â€ It is Sisyphus in unicode. I use it at least 10 times a day.\\nFor a long time, however, I used it with some difficulty. Unlike better-known emoticons like :slightly_smiling_face: or :wink:, Â¯\\\\_(ãƒ„)_/Â¯ borrows characters from the Japanese syllabary called katakana. That makes it a kaomoji, a Japanese emoticon; it also makes it, on Western alphabetical keyboards at least, very hard to type.','U5TQU3WQ7','2017-12-13 14:47:36');
